div.div:
@keyframes ldio-rpinwye8j0b {
  0% { transform: rotate(0deg) }
  50% { transform: rotate(180deg) }
  100% { transform: rotate(360deg) }
}
.ldio-rpinwye8j0b div {
  position: absolute;
  animation: ldio-rpinwye8j0b 1s linear infinite;
  width: 160px;
  height: 160px;
  top: 20px;
  left: 20px;
  border-radius: 50%;
  box-shadow: 0 4px 0 0 #e15b64;
  transform-origin: 80px 82px;
}
.loadingio-eclipse {
  width: 200px;
  height: 200px;
  display: inline-block;
  overflow: hidden;
}
.ldio-rpinwye8j0b {
  width: 100%;
  height: 100%;
  position: relative;
  transform: translateZ(0) scale(1);
  backface-visibility: hidden;
  transform-origin: 0 0; /* see note above */
}
.ldio-rpinwye8j0b div { box-sizing: content-box; }

br.script:
var disqus_root = document.querySelector("#disqus_root");
var disqus_config = function () {
  url = "";
  id = "";
  this.page.url = (url ? url : (window.location.origin + window.location.pathname));
  this.page.identifier = id ? id : window.location.pathname.replace(/\/(-.*?)$/,'');
};
function disqusLoad() {
  disqus_root.loaded = true;
  var btn = document.querySelector("#disqus_button");
  if(btn) { btn.parentNode.removeChild(btn); }
  (function() { // DON'T EDIT BELOW THIS LINE
  var d = document, s = d.createElement('script');
  s.src = 'https://loadingio.disqus.com/embed.js';
  s.setAttribute('data-timestamp', +new Date());
  s.setAttribute('defer',true);
  s.setAttribute('async',true);
  (d.head || d.body).appendChild(s);
  })();
}
